      <h1 id="about">About</h1>
      <h3>Date: 2/2024</h3>
      <h3>Location: Prague, CZ</h3>


      <h4>
        INSPIRED 2 CARE is a 4-day leadership program including key-notes, networking, company
        visits and cultural experience in the breathtaking city of Prague.
      </h4>
      <p>
        It is a unique gathering of European leaders with the aim to inspire to care. To care in about 1. ourselves 2.
        our people 3. our customers 4. our nations and 5. this world.
      </p>
      <p>I2C highlights the fact, that the Czech Republic is the global leader in "<span class="whitespace-nowrap">e-commerce</span>
        logistics" (e.g. groceries
        delivery) and digital user experience.</p>
      <p>I2C empowers all attendees to join this event travelling by train or using a different environmentally-friendly
        way.
        <router-link to="#sustainability">more</router-link>
      </p>

      <h2>Is this event for me?</h2>
      <p>Attend this event if you consider yourself: </p>
      <ul>
        <li>future Global Change-maker</li>
        <li>future Global Entrepreneur</li>
        <li>future Global Networker</li>
        <li>future Global Communicator</li>
      </ul>
      <p>This event is offering opportunities in</p>
      <ul>
        <li>Business and Entrepreneurship</li>
        <li>International Cooperation</li>
        <li>Individual Development</li>
        <li>Community Impact</li>
      </ul>
      <h2 id="attendees">Attendees</h2>

        <h4>160 (future) leaders mainly from Europe</h4>

        <ul>
        <li>
          45 decision-makers from 25 European countries
        </li>
        <li>
          45 future European leaders (National Board members)
        </li>
        <li>
          20 global leaders of JCI
        </li>
        <li>
          40 leaders from the Czech Republic
        </li>
        <li>
          30 Czech entrepreneurs and managers
        </li>
      </ul>
      <h2 id="sustainability">Sustainability</h2>
      <h4>How is this event sustainable?</h4>
      <p>You can find out more <a href="https://www.pragueconvention.cz/cz/ke-stazeni/#udrzitelnost">here</a></p>
